// Debug RSS feed output
const allItems = $input.all();

console.log(`🔍 RSS Debug - Total items received: ${allItems.length}`);

if (allItems.length === 0) {
  console.log('❌ No RSS items received!');
  return [{ json: { error: 'No RSS items received', debug: 'RSS feed may be blocked or timing out' } }];
}

// Log first few items for debugging
allItems.slice(0, 3).forEach((item, index) => {
  console.log(`📰 Item ${index + 1}:`);
  console.log(`  Title: ${item.json.title || 'NO TITLE'}`);
  console.log(`  Link: ${item.json.link || 'NO LINK'}`);
  console.log(`  PubDate: ${item.json.pubDate || 'NO DATE'}`);
  console.log(`  Description length: ${(item.json.description || '').length}`);
  console.log(`  All keys: ${Object.keys(item.json).join(', ')}`);
});

return allItems.map((item, index) => ({
  json: {
    index: index + 1,
    title: item.json.title || 'NO TITLE',
    link: item.json.link || 'NO LINK',
    pubDate: item.json.pubDate || 'NO DATE',
    hasDescription: !!(item.json.description || item.json.contentSnippet),
    descriptionLength: (item.json.description || '').length,
    allKeys: Object.keys(item.json)
  }
}));
